import styled from 'styled-components';

export const ContentStyled = styled.div`
	position: relative;
	top: ${({ theme }) => theme.menuHeight};
	min-height: 100vh;
	padding-top: 120px;
	background: url('client/public/images/backgrounds/keyboard-image.png');
	height: auto;
`;
